import React from 'react';
import {Switch, Route} from 'react-router-dom'
import './App.css';
import HomePage from './pages/homepage/Homepage.jsx'


const HatsPage = () => (
  <div>
    <h1>Hats</h1>
  </div>
)


function App() {
  return (
    <div >
      <Switch>
        <Route path='/' component={HomePage} />
        <Route path='/hats' component={HatsPage} />
      </Switch>
    </div>
  );
}

export default App;
